import React from 'react';
import { NavLink } from "react-router-dom";



const Navigation = () => {
    return (
            <div class="navigation">
                <ul class="navigation__list">
                    <NavLink to="/" class="main__item"><span class="slash">/</span>Jay Pardel.</NavLink>
                    <NavLink to="/about" class="navigation__item">about</NavLink>
                    <NavLink to="/projects" class="navigation__item">projects</NavLink>
                    <NavLink to="/contact" class="navigation__item">contact</NavLink>
                </ul>
            </div>

    )
}

export default Navigation;
